[package]
name = "leptos_icons"
version = "0.0.1"
edition = "2021"
authors = ["Bruno De Simone"]
license = "MIT"
repository = "https://github.com/bankai-labs/leptos-icons"
description = "Easily include a variety of SVG icons into your Leptos app, inspired by yew_icons"
exclude = [
    "/bootstrap",
    "/feather",
    "/Font-Awesome",
    "/heroicons",
    "/octicons",
    "/lipis-flag-icons",
    "/lucide",
    "/docs",
    "/test-app",
]

# See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html

[[bin]]
name = "generator"
path = "src/generator.rs"
required-features = ["generator"]

[dependencies]
leptos = { git = "https://github.com/leptos-rs/leptos", default-features = false }
quote = { version = "1.0", optional = true }
convert_case = { version = "0.5", optional = true }
proc-macro2 = { version = "1.0", optional = true }
enum-iterator = { version = "0.7", optional = true }
regex = { version = "1", optional = true }
base64 = { version = "0.13", optional = true }
cfg-if = "1.0.0"

[features]
default = []
generator = ["quote", "convert_case", "proc-macro2", "regex", "base64"]

